import enumify from '../../../enums/enumify';

export default function IsoFormat() {}

enumify(IsoFormat, {
    Year: 'YYYY',
    Month: 'YYYY-MM',
    Date: 'YYYY-MM-DD',
    Seconds: 'YYYY-MM-DDTHH:mm:ss',
    TimeSeconds: 'HH:mm:ss',
    TimeMilliseconds: 'HH:mm:ss.SSS',
    TimeMicroseconds: 'HH:mm:ss.SSSSSS',
    Milliseconds: 'YYYY-MM-DDTHH:mm:ss.SSS',
    Microseconds: 'YYYY-MM-DDTHH:mm:ss.SSSSSS',
    UtcSeconds: 'YYYY-MM-DDTHH:mm:ssZ',
    UtcMilliseconds: 'YYYY-MM-DDTHH:mm:ss.SSSZ',
});
